import React from 'react';
import axios from 'axios';

export default class Donnees extends React.Component {
  state = {
    villes: []
  }

  componentDidMount() {
    axios.get(`http://localhost:8081/?pollutionHourtin=85`)
      .then(res => {
        const villes = res.data;
        this.setState({ villes });
      })
  }

  render() {
    return (
      <ul>
        {
          this.state.villes
            .map(ville =>
              <li key={ville.id}>{ville.nom}</li>
            )
        }
      </ul>
    )
  }
}
